import "./contact.css"

const ContactUs = () => {
    return (
        <div className="main-contact-box">

            <section id="contact">
                <h6 className="cont-head">What Next?</h6>
                <h3 className="njaJNje">Get in Touch</h3>
                <div className="gUsVuV"><p>My inbox is always open. Whether you have a question or just want to say hello, I'll try my best to get back to you! Feel free to mail me about any relevant job updates.</p></div>
                <a href="mailto:singhmagan9304@gmail.com" target="_blank" rel="nofollow noopener noreferrer" class="contact__StyledEmailLink-sc-sehid-3 dXyrwW">Mail Me</a>
            </section>
        </div>
    );
}

export default ContactUs;
